import React from 'react';

function MenuBar({ setActiveView }) {
  return (
    <div className="menu-bar">
      <button onClick={() => setActiveView('channels')}>Channels</button>
      <button onClick={() => setActiveView('messages')}>Messages</button>
      <button onClick={() => setActiveView('replies')}>Replies</button>
    </div>
  );
}

export default MenuBar;
